// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "./interfaces/IPriviAMM.sol";
import "./PodManager.sol";
import "./Structs.sol";

/**
 * @title manager for pod amms
 * @author Eric Nordelo
 * @notice manages the buying and selling of the pod amm tokens
 */
contract PodAMMManager is AccessControl {
    bytes32 public constant TRADING_STATE = keccak256("TRADING");

    address private immutable podManagerContractAddress;

    constructor(address _podManagerContractAddress) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        podManagerContractAddress = _podManagerContractAddress;
    }

    /**
     * @notice buy amm tokens
     * @param _podAddress the address of the pod
     * @param _amount the amount of pod tokens to buy
     */
    function buyPodTokens(address _podAddress, uint256 _amount) external {
        PodInfo memory podInfo = PodManager(podManagerContractAddress).getPodInfo(_podAddress);
        require(podInfo.status == TRADING_STATE, "Invalid pod state (not trading)");
        IPriviAMM(podInfo.ammAddress).buyTokens(msg.sender, _amount);
    }

    /**
     * @notice sell amm tokens
     * @param _podAddress the address of the pod
     * @param _amount the amount of pod tokens to sell
     */
    function sellPodTokens(address _podAddress, uint256 _amount) external {
        PodInfo memory podInfo = PodManager(podManagerContractAddress).getPodInfo(_podAddress);
        require(podInfo.status == TRADING_STATE, "Invalid pod state (not trading)");
        IPriviAMM(podInfo.ammAddress).sellTokens(msg.sender, _amount);
    }
}

